codons = dict()
codons['F'] = 'UUU','UUC'
codons['L'] = 'UUA','UUG','CUU','CUC','CUA','UUA','UUG','CUG'
codons['I'] = 'AUU','AUC','AUA'
codons['S'] = 'UCU', 'UCC','UCA','AGU','AGC','UCG'
codons['P'] = 'CCU','CCC','CCA','CCG'
codons['T'] = 'ACU', 'ACC', 'ACA', 'ACG'
codons['V'] = 'GUC','GUU','GUA','GUG'
codons['A'] = 'GCU','GCC','GCA','GCG'
codons['Y'] = 'UAU','UAC'
codons['G'] = 'GGU','GGC','GGA','GGG'
codons['M'] = 'AUG'
codons['H'] = 'CAU', 'CAC'
codons['N'] = 'AAU', 'AAC'
codons['D'] = 'GAU', 'GAC'
codons['Q'] = 'CAA', 'CAG'
codons['K'] = 'AAA', 'AAG'
codons['E'] = 'GAA', 'GAG'
codons['C'] = 'UGU', 'UGC'
codons['R'] = 'CGU', 'CGA', 'CGC', 'CGG', 'AGA', 'AGG'
codons['W'] = 'UGG'
codons['Stop'] = 'UAA', 'UAG', 'UGA'

protein_aa = []
string_a = ''

def get_codon(val):
    for key, value in codons.items():
        if val in value:
            if key == 'Stop':
                print('Stop codon found!')
            else:
                return key

for i in range(int(len(string_a)/3)):
    n = i*3
    aa_code = string_a[n:n+3]
    if  get_codon(aa_code) == None:
        break
    else:
        protein_aa.append(get_codon(aa_code))
    

protein_code = ''.join(str(i) for i in protein_aa)
print(protein_code)
    








 
